('1606','18','7451','Villaprojekt Isidoro',Null,'Moderne Villa mit Panoramablick in Sol de Mallorca','15859','Dieses 1.798 m² große Grundstück befindet sich in sehr ruhiger Lage in der beliebten Wohnlage Sol de Mallorca. Mehrere Supermärkte, Golfplätze und Jachthäfen mit Restaurants und Bars  liegen nur wenige Fahrminuten entfernt. Die Villa in modernem Stil wurde 2012 von einem erfahrenen Bauträger fertig gestellt \r\nDie  möblierte Villa hat ca. 462 m² Wohnfläche, die sich auf 2 Etagen verteilt. Im Erdgeschoss befinden sich der Eingang mit Diele, ein großzügiges Wohn- Esszimmer (77 m²) mit Kamin,  Einbauküche, Gästetoilette und ein Schlafzimmer mit Bad. In der oberen Etage liegen 3 weitere Schlafzimmer, jeweils mit Bad en suite.\r\nZur Ausstattung gehören u.a. Panorama-Doppelglasfenster, Fußbodenheizung, Klimaanlage w/k, isolierte Außenwände u.v.m.\r\nEs besteht noch die Möglichkeit ein Gästeapartment mit 37 m² zu errichten oder auch einen Tennisplatz','15860','1500000','111','2011-08-05 13:29:25','110','2011-08-05 13:30:04',Null,'1045','125','364',1,'1','0',Null,Null,Null,'15861',Null,'0','0','0',Null,'2015-06-29 16:11:30',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'15862',Null,'15863',Null,'15864',Null,'15865',Null,'15866','0',0,'0');
